import React from "react";
import logo from '../../utils/logoG.png'

 export const Footer = ()=>{
    const style1 = {
        backgroundImage:`url(${logo})`,
        backgroundRepeat: 'no-repeat',
        backgroundPosition: 'center',
        backgroundSize: 'cover',
        width:'2.5rem',
        height:'2.5rem'
    }
    const style = {
        backgroundImage:`url(${logo})`,
        backgroundRepeat: 'no-repeat',
        backgroundPosition: 'center',
        backgroundSize: 'cover',
        width:'2.5rem',
        height:'2.5rem'
    }
    return(
        <footer>
            created by Johan Cortes
            <div style={style1}></div>
            <div style={style}></div>
        </footer>
    )
}
